import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
//import {Button} from '@material-ui/core'
import {Route, Switch} from 'react-router-dom'
import Login from './views/Login/Login.js'
import axios from 'axios'

import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox } from 'antd';
import { UserOutlined, LockOutlined } from '@ant-design/icons';


//const serv = '127.0.0.1:8000/'
//const serv2 = 'localhost:8000/api'

function User(props) {
  const [token, setToken] = useState('')

  // const handleClick = () => {
  //   axios.get('http://127.0.0.1:8000/api/').then(response => {
  //     console.log(response);
  //     setData(response.data.results[0].title)
  //   }).catch(error => console.log(error))
  // }

  const handleRegister = () => {
    axios.post('http://127.0.0.1:8000/auth/users/', {
      username: 'dom',
      password: 'Dom12345678',
      email: 'dom@gmail.com'
    }).then(
      response => console.log(response)).catch(error => console.log(error))
  }

  const handleLogin = () => {
    axios.post('http://127.0.0.1:8000/auth/jwt/create/', {
      username: 'dom',
      password: 'Dom12345678'
    }).then(
      response => {console.log(response); setToken(response.data.access)}).catch(error => console.log(error))
  }

  // setToken(response.data.token)

  let config = {
    headers: {
      "Authorization": `JWT ${token}`,
      'Content-Type': 'application/json',
      "Accept": "application/json"
    }
  }

  const handleGetUser = () => {
    console.log(config.headers.Authorization)
    axios.get('http://127.0.0.1:8000/auth/users/me/', config).then(
      response => console.log(response)).catch(error => console.log(error))
  }

  const onFinish = (values) => {
    console.log(values)
  }
/*
  const chatSocket = new WebSocket(
    'ws://'
    + window.location.host
    + '/ws/chat/'
    + roomName
    + '/'
);


chatSocket.onmessage = function(e) {
  const data = JSON.parse(e.data);
  document.querySelector('#chat-log').value += (data.message + '\n');
};

chatSocket.onclose = function(e) {
  console.error('Chat socket closed unexpectedly');
};

chatSocket.send(JSON.stringify({
  'message': message
}));
*/

  return (
    <div>
        <Form
      name="normal_login"
      className="login-form"
      initialValues={{
        remember: true,
      }}
      onFinish={onFinish}
    >
      <Form.Item
        name="username"
        rules={[
          {
            required: true,
            message: 'Please input your Username!',
          },
        ]}
      >
        <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Username" />
      </Form.Item>
      <Form.Item
        name="password"
        rules={[
          {
            required: true,
            message: 'Please input your Password!',
          },
        ]}
      >
        <Input
          prefix={<LockOutlined className="site-form-item-icon" />}
          type="password"
          placeholder="Password"
        />
      </Form.Item>
      <Form.Item>
        <Form.Item name="remember" valuePropName="checked" noStyle>
          <Checkbox>Remember me</Checkbox>
        </Form.Item>

        <a className="login-form-forgot" href="">
          Forgot password
        </a>
      </Form.Item>

      <Form.Item>
        <Button type="primary" htmlType="submit" className="login-form-button">
          Log in
        </Button>
        Or <a href="">register now!</a>
      </Form.Item>
    </Form>


      <Button onClick={handleRegister}>
      Register Jimmy
      </Button>
      <Button onClick={handleLogin}>
      Log in Jimmy
      </Button>
      <Button onClick={handleGetUser}>
        Get Jimmy
      </Button>
    </div>
  )
}

function Channel(props) {
  return (
    <div>
      <p>channels</p>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
          {/* <User></User> */}
          {/* <Channel></Channel> */}
        {/* <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
      <Switch>
        <Route exact path = "/login" component = {Login} />
      </Switch>
    </div>
  );
}

export default App;
